import Pokedex from "./Pokedex";

export default function PokemonCard({ name, id, img }) {
  return (
    <div className="col-md-3 col-sm-6 mb-5">
      <div className="card">
        <div className="card-header">
          <h3>{name}</h3>
          <h3>{id}</h3>
          {img}
        </div>
      </div>
    </div>
  );
}
